import collections
class Solution:
    def paint_fence(self, canvas: str, x, y, z) -> int:
        offers = collections.Counter()
        for i in range(1, x):
            for j in range(y, y + i):
                for k in range(z, z + i):
                    if canvas[i][j] == '1':
                        if (i, j, k) not in offers:
                            offers[(i, j, k)] = 1
                        else:
                            offers[(i, j, k)] += 1
        return sum(list(offers.values()))

