from collections import defaultdict

class Solution:
    def __init__(self):
        self.ans = 0
    def solution(self, stdin):
        d, n = map(int, stdin.split())
        x = [list(map(int, input().split())) for _ in range(n)]
        x = sorted(x, key=lambda x: x[0] + x[1])

        i = 0
        while i < n - 1:
            s, e = x[i][0] + x[i+1][0], x[i][1] + x[i+1][1]
            if s < d and e < d:
                i += 1
            else:
                break

        self.ans = max(self.ans, d - s)
        return self.ans

