import sys

class Node:
    def __init__(self):
        self.key = 0
        self.parent = 0
        self.left = 0
        self.right = 0

class Solution:
    def __init__(self):
        self.root = None
        self.ans = -1

    def insert(self, level: int, key: int):
        if level == self.ans or self.root is None:
            self.ans = level
            return

        if level < self.ans:
            if self.root:
                self.root.left = Node()
                self.root = self.root.left
            self.root = Node()
            self.root.left = self.insert(level + 1, key)
        else:
            if self.root.left:
                self.root.right = Node()
                self.root.right.left = self.root.left
                self.root.left = self.root.right.right = Node()
                self.root.right.right = Node()

    def search(self, level: int, key: int):
        if level == self.ans or self.root is None:
            return

        if level < self.ans:
            self.root.left = self.search(level + 1, key)
        else:
            self.root.right = self.search(level + 1, key)

    def solution(self, stdin: str) -> str:

        N, E, D, a = map(int, stdin.split())
        self.root = Node()
        self.insert(0, a)

        for _ in range(D):
            self.search(0, E)

        for _ in range(E):
            self.search(0, a)

        for _ in range(N):
            self.search(0, E)

        return '0' if self.ans == -1 else str(self.root.key)

