import sys

class Solution:
    def shortestDistance(self, n: int, connections: List[List[int]]) -> str:
        def check(start, i, end):
            dist = sys.maxsize
            for j in connections[i]:
                if j == start or j == end:
                    continue
                dist = min(dist, abs(j - start) + abs(i - j))
            return dist

        def dfs(start, end, index, visited):
            if index == n:
                return check(start, 0, end) + 1
            visited[start] = True
            ans = sys.maxsize
            for i in range(n):
                if visited[i] == True:
                    continue
                ans = min(ans, dfs(start, end, i, visited) + 1)
            visited[end] = True
            return ans

        ans = sys.maxsize
        visited = [False] * n
        for i in range(n):
            if visited[i] == True:
                continue
            ans = min(ans, dfs(0, n - 1, i, visited) + 1)
            visited[i] = True
        return ans

