Input

The first line contains an integer $n$ ($2 \le n \le 500$), the number of ports;
The $i$th line contains $n-i$ integers. The $j$th integer on the $i$th line denotes the distance between port $i$ and port $i+j$ in kilometres. Each distance is between $1$ and $10^6$ (inclusive).

Output

Output the average distance between port towns in kilometres. Your answer should have an absolute or relative error of at most $10^{-9}$ (for example, if you are trying to calculate the average of the distances between port towns between two pairs of port towns, then your answer should be $2.13333333333333).
"""

import sys

class Solution:
    def shortestDistance(self, n: int, connections: List[List[int]]) -> str:
        def check(start, i, end):
            dist = sys.maxsize
            for j in connections[i]:
                if j == start or j == end:
                    continue
                dist = min(dist, abs(j - start) + abs(i - j))
            return dist

        def dfs(start, end, index, visited):
            if index == n:
                return check(start, 0, end) + 1
            visited[start] = True
            ans = sys.maxsize
            for i in range(n):
                if visited[i] == True:
                    continue
                ans = min(ans, dfs(start, end, i, visited) + 1)
            visited[end] = True
            return ans

        ans = sys.maxsize
        visited = [False] * n
        for i in range(n):
            if visited[i] == True:
                continue
            ans = min(ans, dfs(0, n - 1, i, visited) + 1)
            visited[i] = True
        return ans

