from heapq import heappop, heappush

class Solution:
    def largestSize(self, n: int, edges: List[List[int]]) -> int:
        G = [[] for _ in range(n)]
        for e in edges:
            u, v = e[0], e[1]
            G[u].append(v)
            G[v].append(u)

        def dfs(start):
            visited = [start]
            queue = [start]

            while queue:
                u = queue.pop(0)
                for v in G[u]:
                    if v not in visited:
                        visited.append(v)
                        queue.append(v)

            return visited

        visited = []
        for i in range(n):
            if i not in visited:
                visited.append(i)
                visited = dfs(i)

        return len(visited)

